import React from "react";
import styled from "styled-components";
import "../color/Theme.js";

const FooterWrapper = styled.footer`
  display: flex;
  justify-content: space-between;
  padding: 20px;
  background-color: #333;
  color: #fff;
  div {
    flex: 1;
    margin-right: 20px;
  }
`;


const Footer = () => {
  return (
    <FooterWrapper>
    <div>
      <h3>(주)</h3>
      <p>유니티 제작가 린튼 부사장이 말하는, 기술을 넘어선 사회 공헌</p>
    </div>
    <div>
      <h3>모장 해도 인터뷰</h3>
      <p>게임과학포럼</p>
    </div>
    <div>
      <h3>개발과학포럼</h3>
      <p>젠더스 줄 재료</p>
    </div>
  </FooterWrapper>
  );
};
export default Footer;
